import React from "react";
import Card from "./Card";

const AlgorithmsPage: React.FC = () => {
    return (
        <div className="bg-white flex flex-wrap items-start justify-center h-screen gap-6 p-4 top-2">
            <Card
                title="Sorting Algorithms"
                description="Explore various sorting techniques like Quick Sort, Merge Sort, and Bubble Sort."
            />
            <Card
                title="Search Algorithms"
                description="Learn about binary search, linear search, and other search techniques."
            />
            <Card
                title="Graph Algorithms"
                description="Understand algorithms like Dijkstra's, A*, and BFS/DFS for graph traversal."
            />
            <Card
                title="Dynamic Programming"
                description="Master techniques for solving problems with overlapping subproblems and optimal substructure."
            />
        </div>
    );
};


export default AlgorithmsPage;
